import React from 'react';
import logosolo2 from './logosolo2.png';

const Cabecera = () => {
return (



<nav class="db dt-l w-100 border-box pa3 ph5-l">
  <a class="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l" href="https://github.com/" title="Home">
    <img src={logosolo2} class="dib br-100" alt="Site Name"/>
  </a>
  <div class="db dtc-l v-mid w-100 w-75-l tc tr-l">
    <a className="f4 dib  bg-animate hover-bg-black hover-white no-underline pv2 ph4 mh2 br-pill ba b--black-20 black pa2" href="https://www.google.com">About</a>
    <a className="f4 dib  bg-animate hover-bg-black hover-white no-underline pv2 ph4 mh2 br-pill ba b--black-20 black pa2" href="https://www.google.com">Contacto</a>
    <a className="f4 dib  bg-animate hover-bg-black hover-white no-underline pv2 ph4 mh2 br-pill ba b--black-20 black pa2" href="https://www.google.com">Blog</a>

  </div>
</nav>


);
}

export default Cabecera;
